// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract MultiAuction {
    struct Auction {
        address payable seller;
        uint startTime;
        uint endTime;
        bool ended;
        bool auctionStarted;
        address highestBidder;
        uint highestBid;
        uint minIncrement;
        uint extensionTime;
        uint maxBid;
        string itemName;
        string imageUrl;
    }

    uint public auctionCounter;
    mapping(uint => Auction) public auctions;
    mapping(uint => mapping(address => uint)) public pendingReturns;

    bool private locked;

    event AuctionCreated(uint indexed auctionId, address indexed seller, string itemName);
    event HighestBidIncreased(uint indexed auctionId, address indexed bidder, uint amount);
    event AuctionExtended(uint indexed auctionId, uint newEndTime);
    event AuctionEnded(uint indexed auctionId, address winner, uint amount);
    event AuctionCancelled(uint indexed auctionId);
    event Withdrawn(uint indexed auctionId, address indexed who, uint amount);

    modifier noReentrant() {
        require(!locked, "Reentrant call");
        locked = true;
        _;
        locked = false;
    }

    modifier onlyAuctionSeller(uint _auctionId) {
        require(msg.sender == auctions[_auctionId].seller, "Only auction seller");
        _;
    }


    function createAuction(
        string memory _itemName,
        string memory _imageUrl,
        uint _biddingTime,
        uint _minIncrement,
        uint _extensionTime,
        uint _maxBid
    ) external returns (uint) {
        require(_biddingTime > 0, "Invalid bidding time");
        require(_minIncrement > 0, "Invalid min increment");

        uint auctionId = auctionCounter++;

        Auction storage newAuction = auctions[auctionId];
        newAuction.seller = payable(msg.sender);
        newAuction.itemName = _itemName;
        newAuction.imageUrl = _imageUrl;
        newAuction.startTime = block.timestamp;
        newAuction.endTime = block.timestamp + _biddingTime;
        newAuction.minIncrement = _minIncrement;
        newAuction.extensionTime = _extensionTime;
        newAuction.maxBid = _maxBid;
        newAuction.auctionStarted = true;
        newAuction.ended = false;

        emit AuctionCreated(auctionId, msg.sender, _itemName);

        return auctionId;
    }

    function bid(uint _auctionId) external payable {
        Auction storage auction = auctions[_auctionId];

        require(auction.auctionStarted, "Auction not started");
        require(block.timestamp < auction.endTime, "Auction ended");
        require(msg.sender != auction.seller, "Seller cannot bid");

        uint required = auction.highestBid + auction.minIncrement;
        require(msg.value >= required, "Bid below min increment");

        if (auction.maxBid != 0) {
            require(msg.value <= auction.maxBid, "Above maxBid");
        }

        if (auction.highestBid != 0) {
            pendingReturns[_auctionId][auction.highestBidder] += auction.highestBid;
        }

        auction.highestBidder = msg.sender;
        auction.highestBid = msg.value;

        if (auction.endTime - block.timestamp < auction.extensionTime) {
            auction.endTime += auction.extensionTime;
            emit AuctionExtended(_auctionId, auction.endTime);
        }

        emit HighestBidIncreased(_auctionId, msg.sender, msg.value);
    }

    function withdraw(uint _auctionId) external noReentrant returns (bool) {
        uint amount = pendingReturns[_auctionId][msg.sender];
        require(amount > 0, "No funds");

        pendingReturns[_auctionId][msg.sender] = 0;

        (bool success, ) = payable(msg.sender).call{value: amount}("");
        if (!success) {
            pendingReturns[_auctionId][msg.sender] = amount;
            return false;
        }

        emit Withdrawn(_auctionId, msg.sender, amount);
        return true;
    }

    function endAuction(uint _auctionId) external onlyAuctionSeller(_auctionId) noReentrant {
        Auction storage auction = auctions[_auctionId];

        require(auction.auctionStarted, "Auction not started");
        require(block.timestamp >= auction.endTime, "Auction not yet ended");
        require(!auction.ended, "Already ended");

        auction.ended = true;
        auction.auctionStarted = false;

        emit AuctionEnded(_auctionId, auction.highestBidder, auction.highestBid);

        if (auction.highestBid > 0) {
            (bool success, ) = auction.seller.call{value: auction.highestBid}("");
            if (!success) {
                pendingReturns[_auctionId][auction.seller] += auction.highestBid;
            }
        }
    }

    function cancelAuction(uint _auctionId) external onlyAuctionSeller(_auctionId) noReentrant {
        Auction storage auction = auctions[_auctionId];
        require(!auction.ended, "Already ended");

        auction.ended = true;
        auction.auctionStarted = false;

        emit AuctionCancelled(_auctionId);

        if (auction.highestBid != 0) {
            pendingReturns[_auctionId][auction.highestBidder] += auction.highestBid;
        }
    }

    function getAuction(uint _auctionId) external view returns (
        address seller,
        string memory itemName,
        string memory imageUrl,
        uint endTime,
        address highestBidder,
        uint highestBid,
        bool ended,
        bool auctionStarted
    ) {
        Auction storage auction = auctions[_auctionId];
        return (
            auction.seller,
            auction.itemName,
            auction.imageUrl,
            auction.endTime,
            auction.highestBidder,
            auction.highestBid,
            auction.ended,
            auction.auctionStarted
        );
    }

    function getActiveAuctionsCount() external view returns (uint) {
        uint count = 0;
        for (uint i = 0; i < auctionCounter; i++) {
            if (auctions[i].auctionStarted && !auctions[i].ended) {
                count++;
            }
        }
        return count;
    }
}
